import React from 'react';
import HelloWorld from '../Components/HelloWorld';

function Home() {
  return (
    <div>
      <h1 className="font-bold text-2xl mb-3">Homebrew Pokedex</h1>
      <HelloWorld name="Seth" />
    </div>
  );
}

export default Home;
